import React, { useState, useContext } from "react";
import {
  Typography,
  Box,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  IconButton,
  Chip,
  useMediaQuery,
  useTheme,
  List,
  ListItem,
  ListItemText,
  Divider,
  Stack,
  Button,
  Menu,
  MenuItem,
  Drawer,
  AppBar,
  Toolbar
} from "@mui/material";
import MoreVertIcon from '@mui/icons-material/MoreVert';
import AddIcon from '@mui/icons-material/Add';
import ArrowDropUpIcon from '@mui/icons-material/ArrowDropUp';
import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown';
import GeneralContext from "../context/GeneralContext";
// In Dashboard.js, WatchList.js, etc.
import { YourContextProvider } from '../context/GeneralContext'; 


// Sample data
const sampleStocks = [
  { 
    id: 1,
    symbol: "RELIANCE", 
    ltp: 2540.75, 
    change: 15.50, 
    changePercent: 0.62,
    volume: "2.5M"
  },
  { 
    id: 2,
    symbol: "HDFCBANK", 
    ltp: 1650.25, 
    change: -12.30, 
    changePercent: -0.74,
    volume: "1.8M"
  },
  { 
    id: 3,
    symbol: "TCS", 
    ltp: 3450.00, 
    change: 45.75, 
    changePercent: 1.35,
    volume: "950K"
  },
  { 
    id: 4,
    symbol: "INFY", 
    ltp: 1475.60, 
    change: -5.40, 
    changePercent: -0.36,
    volume: "1.2M"
  },
  { 
    id: 5,
    symbol: "ICICIBANK", 
    ltp: 945.30, 
    change: 12.45, 
    changePercent: 1.33,
    volume: "2.1M"
  }
];

const WatchList = () => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('md'));
  const { openBuyWindow } = useContext(GeneralContext);

  const [anchorEl, setAnchorEl] = useState(null);
  const [selectedStock, setSelectedStock] = useState(null);
  const [mobileDrawerOpen, setMobileDrawerOpen] = useState(false);

  const handleMenuOpen = (event, stock) => {
    setAnchorEl(event.currentTarget);
    setSelectedStock(stock);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleBuy = () => {
    if (selectedStock) {
      openBuyWindow(selectedStock.id);
      handleMenuClose();
    }
  };

  const toggleMobileDrawer = () => {
    setMobileDrawerOpen(!mobileDrawerOpen);
  };

  return (
    <Box sx={{ p: { xs: 0.5, sm: 1, md: 2 } }}>
      <Stack direction="row" justifyContent="space-between" alignItems="center" sx={{ mb: 2 }}>
        <Typography variant="h5" sx={{ fontSize: { xs: '1.2rem', sm: '1.5rem' } }}>
          WatchList
        </Typography>
        {isMobile ? (
          <Button 
            variant="outlined" 
            size="small" 
            startIcon={<AddIcon />}
            onClick={toggleMobileDrawer}
          >
            Add
          </Button>
        ) : (
          <Button 
            variant="outlined" 
            size="small" 
            startIcon={<AddIcon />}
          >
            Add Symbol
          </Button>
        )}
      </Stack>

      {/* Desktop view - Table */}
      {!isMobile && (
        <TableContainer component={Paper}>
          <Table size="small" aria-label="watchlist table">
            <TableHead>
              <TableRow>
                <TableCell>Symbol</TableCell>
                <TableCell align="right">LTP</TableCell>
                <TableCell align="right">Change</TableCell>
                <TableCell align="right">Change %</TableCell>
                <TableCell align="right">Volume</TableCell>
                <TableCell align="right">Actions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {sampleStocks.map((stock) => (
                <TableRow key={stock.id}>
                  <TableCell component="th" scope="row">
                    {stock.symbol}
                  </TableCell>
                  <TableCell align="right">{stock.ltp.toFixed(2)}</TableCell>
                  <TableCell 
                    align="right"
                    sx={{ 
                      color: stock.change >= 0 ? 'success.main' : 'error.main',
                      display: 'flex',
                      alignItems: 'center',
                      justifyContent: 'flex-end'
                    }}
                  >
                    {stock.change >= 0 ? <ArrowDropUpIcon /> : <ArrowDropDownIcon />}
                    {Math.abs(stock.change).toFixed(2)}
                  </TableCell>
                  <TableCell 
                    align="right"
                    sx={{ color: stock.changePercent >= 0 ? 'success.main' : 'error.main' }}
                  >
                    {stock.changePercent >= 0 ? '+' : ''}{stock.changePercent.toFixed(2)}%
                  </TableCell>
                  <TableCell align="right">{stock.volume}</TableCell>
                  <TableCell align="right">
                    <IconButton 
                      size="small" 
                      onClick={(e) => handleMenuOpen(e, stock)}
                      aria-label="more options"
                    >
                      <MoreVertIcon fontSize="small" />
                    </IconButton>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}

      {/* Mobile view - List */}
      {isMobile && (
        <List sx={{ bgcolor: 'background.paper' }} component={Paper}>
          {sampleStocks.map((stock, index) => (
            <React.Fragment key={stock.id}>
              <ListItem 
                secondaryAction={
                  <IconButton 
                    edge="end" 
                    aria-label="more options"
                    onClick={(e) => handleMenuOpen(e, stock)}
                  >
                    <MoreVertIcon />
                  </IconButton>
                }
              >
                <ListItemText
                  primary={
                    <Typography variant="body1" fontWeight="medium">
                      {stock.symbol}
                    </Typography>
                  }
                  secondary={
                    <Stack direction="row" spacing={1} alignItems="center">
                      <Typography variant="body2">
                        {stock.ltp.toFixed(2)}
                      </Typography>
                      <Chip
                        label={`${stock.changePercent >= 0 ? '+' : ''}${stock.changePercent.toFixed(2)}%`}
                        size="small"
                        color={stock.changePercent >= 0 ? 'success' : 'error'}
                        sx={{ height: 20, fontSize: '0.7rem' }}
                      />
                    </Stack>
                  }
                />
              </ListItem>
              {index < sampleStocks.length - 1 && <Divider />}
            </React.Fragment>
          ))}
        </List>
      )}

      {/* Mobile Drawer for adding symbols */}
      <Drawer
        anchor="bottom"
        open={mobileDrawerOpen}
        onClose={toggleMobileDrawer}
      >
        <Box sx={{ p: 2, height: '50vh' }}>
          <Typography variant="h6" gutterBottom>
            Add Symbol to WatchList
          </Typography>
          <Divider sx={{ mb: 2 }} />
          {/* Add symbol search and selection UI here */}
          <Typography variant="body2" color="text.secondary" paragraph>
            Search functionality would be implemented here
          </Typography>
          <Button 
            variant="contained" 
            fullWidth 
            onClick={toggleMobileDrawer}
            sx={{ mt: 2 }}
          >
            Close
          </Button>
        </Box>
      </Drawer>

      {/* Context Menu */}
      <Menu
        anchorEl={anchorEl}
        open={Boolean(anchorEl)}
        onClose={handleMenuClose}
      >
        <MenuItem onClick={handleBuy}>Buy</MenuItem>
        <MenuItem onClick={handleMenuClose}>Sell</MenuItem>
        <MenuItem onClick={handleMenuClose}>View Chart</MenuItem>
        <MenuItem onClick={handleMenuClose}>Remove from WatchList</MenuItem>
      </Menu>
    </Box>
  );
};

export default WatchList;
